        <option>normal</option>
        <option>grass</option>
        <option>fire</option>
        <option>water</option>
        <option>poison</option>
        <option>fairy</option>
        <option>bug</option>
        <option>ground</option>
        <option>physic</option>
        <option>fighting</option>
        <option>rock</option>
        <option>ghost</option>
        <option>electric</option>
        <option>ice</option>
        <option>dark</option>
      </datalist>{" "}
